
<script lang="ts">
	import { onMount } from "svelte";


  const beginCharCode = "a".charCodeAt(0);
  const endCharCode = "z".charCodeAt(0);
  let currCharCode = beginCharCode;

  function updateCharCode() {
    const currentLetter = String.fromCharCode(currCharCode);
    const currentHighlight = document.getElementById("key" + currentLetter);

    if (currentHighlight) {
      currentHighlight.setAttribute("class", "fil15")
    }

    currCharCode += 1;
    if (currCharCode > endCharCode) {
      currCharCode = beginCharCode;
    }

    const nextLetter = String.fromCharCode(currCharCode);
    const nextHighlight = document.getElementById("key" + nextLetter);
    if (nextHighlight) {
      nextHighlight.setAttribute("class", "filred");
    }
  }

  onMount(() => {
    const interval = setInterval(() => {
      updateCharCode();
    }, 500);
    return () => {
      clearInterval(interval);
    }
  });
</script>



